    true,nt"url": null,nt"notes": "The Autonomous Parsivel Unit (APU) is an
    optical disdrometer based on single particle extinction that measures particle size
    and fall velocity.  This APU consists of the Parsivel, which was developed by OTT
    in Germany, and its support systems, which were designed and built by the University
    of Alabama in Huntsville.  This dataset provides rainfall data for the Global Precipitation
    Measurement (GPM) Mission Ground Validation Experiment collected at the National
    Space Science Technology Center (NSSTC), Huntsville, AL.  There may be occasional
    gaps in the data when the instrument is not resident at the NSSTC and is sent to
    participate in field campaigns.",nt"license_title": "U.S. Government Work",nt"extras":
